import React from 'react';
import "../styles/topbar.css";

export default function Topbar() {
  return (
    <div className="topbar">
      <h1 className="top-logo">Logo</h1>
      <ul className="topbar-list">
        <li className="list-item"><a href="/">HOME</a></li>
        <li className="list-item"><a href="posts">ABOUT</a></li>
        <li className="list-item"><a href="contact">CONTACT</a></li>
        <li className="list-item"><a href="write">WRITE</a></li>
        <li className="list-item"><a href="logout">LOGOUT</a></li>
      </ul>
      <div className="img-search">
        <img className="top-img" src="https://images.pexels.com/photos/5588373/pexels-photo-5588373.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt="blog" />
        <i class="top-search fas fa-search"></i>
      </div>
    </div>
  )
}
